import React, { useState } from "react";

function App() {
  let time = new Date().toLocaleTimeString();
  const newTime = useState(time)

  return (
    <div className="container">
      <h1>TIME</h1>
      <button onClick={newTime}>Get Time</button>
    </div>
  );
}

export default App;
